INSERT INTO `mh4_items` (`_id`, `name`, `name_de`, `name_fr`, `name_es`, `name_it`, `name_jp`, `type`, `sub_type`, `rarity`, `carry_capacity`, `buy`, `sell`, `description`, `description_es`, `icon_name`, `armor_dupe_name_fix`) VALUES
	(1, 'Book of Combos 1', 'Kombi-Buch 1', 'Alchimie, tome 1', 'Libro combos 1', 'Libro alchimia 1', '???????', 1, '', 4, 1, 0, 100, 'An introductory text for first-time combiners. Improves your success rate.', 'Texto introductorio para nuevos combinadores. Da mejores opciones de éxito.', 'Book-Grey.png', ''),
	(2, 'Book of Combos 2', 'Kombi-Buch 2', 'Alchimie, tome 2', 'Libro combos 2', 'Libro alchimia 2', '???????', 1, '', 4, 1, 0, 200, 'A basic text. Owning Book 1 and this improves your combining success rate.', 'Texto básico. Junto con el primer tomo, mejora las opciones de éxito al combinar.', 'Book-Grey.png', ''),
	(3, 'Book of Combos 3', 'Kombi-Buch 3', 'Alchimie, tome 3', 'Libro combos 3', 'Libro alchimia 3', '???????', 1, '', 4, 1, 0, 500, 'An intermediate text. Owning Books 1, 2 and this improves your combining success rate.', 'Texto intermedio. Junto con los dos tomos anteriores, mejora las opciones de éxito.', 'Book-White.png', ''),
	(4, 'Book of Combos 4', 'Kombi-Buch 4', 'Alchimie, tome 4', 'Libro combos 4', 'Libro alchimia 4', '???????', 1, '', 5, 1, 0, 1000, 'An advanced text. Owning Books 1-3 and this improves your combining success rate.', 'Texto avanzado. Junto con los tres tomos anteriores, mejora las opciones de éxito.', 'Book-White.png', ''),
	(5, 'Book of Combos 5', 'Kombi-Buch 5', 'Alchimie, tome 5', 'Libro combos 5', 'Libro alchimia 5', '???????', 1, '', 5, 1, 0, 1500, 'A pro-level text. Owning Books 1-4 and this improves your combining success rate.', 'Texto profesional. Junto con los cuatro tomos anteriores, mejora las opciones de éxito.', 'Book-Yellow.png', ''),
	(6, 'Organizer Guide', 'Organisierführer', 'Comment ranger, tome 1', 'Guía organizador', 'Come organizzare 1', '????????', 2, '', 4, 1, 0, 0, 'An issue of Hunting Life magazine which explains how to maximize Item Box space.', 'Edición de la revista "Vida de caza" que explica cómo usar las cajas Objeto/camarada.', 'Book-Blue.png', ''),
	(7, 'Pack Rat Guide', 'Packführer', 'Comment ranger, tome 2', 'Guía chamarilero', 'Come organizzare 2', '????????', 2, '', 5, 1, 0, 0, 'An issue of Hunting Life magazine containing advanced item-cramming techniques.', 'Edición de la revista "Vida de caza", con un artículo sobre el transporte de objetos.', 'Book-Red.png', ''),
	(8, 'Potion', 'Trank', 'Potion', 'Poción', 'Pozione', '???', 3, '', 1, 10, 0, 7, 'Restores a small amount of Health. Try to combine these into something Mega-better!', 'Restablece ligeramente el nivel de salud.', 'Liquid-Green.png', ''),
	(9, 'Mega Potion', 'Megatrank', 'Méga potion', 'Megapoción', 'Mega-pozione', '???????', 3, '', 2, 10, 0, 16, 'Restores a moderate amount of Health. This potion is a hunter\'s best friend.', 'Restablece moderadamente el nivel de salud.', 'Liquid-Green.png', ''),
	(10, 'Nutrients', 'Nährstoffe', 'Nutriments', 'Nutrientes', 'Nutrienti', '???', 3, '', 2, 5, 0, 25, 'Very slightly increases your maximum Health level.', 'Aumentan ligeramente el nivel de salud.', 'Liquid-Cyan.png', ''),
	(11, 'Mega Nutrients', 'Mega-Nährstoffe', 'Méga nutriments', 'Meganutrientes', 'Mega-nutrienti', '???????', 3, '', 3, 5, 0, 92, 'Slightly increases your maximum Health level.', 'Aumentan ligeramente el nivel máximo de salud.', 'Liquid-Cyan.png', ''),
	(12, 'Antidote', 'Gegengift', 'Antidote', 'Antídoto', 'Antidoto', '???', 3, '', 1, 10, 0, 6, 'Removes all traces of poison from your system.', 'Elimina de forma eficaz cualquier rastro de veneno en tu sistema.', 'Liquid-Blue.png', ''),
	(13, 'Immunizer', 'Impfstoff', 'Immunisateur', 'Inmunizador', 'Immunizzatore', '???', 3, '', 3, 10, 0, 92, 'Boosts your natural ability to heal.', 'Medicina que aumenta la capacidad natural de recuperación.', 'Liquid-Yellow.png', ''),
	(14, 'Dash Juice', 'Sprintsaft', 'Potion de vitalité', 'Zumo de poder', 'Supersucco', '???', 3, '', 2, 5, 0, 29, 'Lets you run without tiring for a short period of time.', 'Te permite correr sin cansarte durante cierto período de tiempo.', 'Liquid-Yellow.png', ''),
	(15, 'Mega Dash Juice', 'Mega-Sprintsaft', 'Potion de vitalité +', 'Megazumo', 'Mega-supersucco', '???????', 3, '', 3, 5, 0, 205, 'Lets you run without tiring for longer than with regular Dash Juice.', 'Te permite correr sin cansarte más tiempo que el Zumo de poder.', 'Liquid-Yellow.png', ''),
	(16, 'Demondrug', 'Dämonenmittel', 'Potion du démon', 'Droga demoníaca', 'Mistura demoniaca', '???', 3, '', 4, 5, 0, 67, 'Boosts your Attack by filling you with -- guess what? -- demonic strength.', 'Aumenta el ataque al otorgar la fuerza de un demonio al que la toma.', 'Liquid-Red.png', ''),
	(17, 'Mega Demondrug', 'Mega-Dämonenmittel', 'Potion du démon +', 'Megadroga demon.', 'Mistura demoniaca+', '???????', 3, '', 5, 5, 0, 283, 'Boosts your Attack even more than a regular Demondrug.', 'Aumenta el ataque aún más que la Droga demoníaca.', 'Liquid-Red.png', ''),
	(18, 'Might Pill', 'Machtpille', 'Philtre du diable', 'Píldora de poder', 'Pillola demoniaca', '?????', 3, '', 1, 5, 0, 280, 'Temporarily endows you with the strength of a mighty god. Potent!', 'Una píldora fortalecedora que te otorga el poder de un dios feroz.', 'Sac-Red.png', ''),
	(19, 'Armorskin', 'Panzerhaut', 'Potion de pierre', 'Piel de armadura', 'Mistura ferrosa', '???', 3, '', 4, 5, 0, 58, 'Boosts your Defense by turning your skin as hard as rock.', 'Aumenta la defensa al endurecer la piel como una armadura de piedra.', 'Liquid-Orange.png', ''),
	(20, 'Mega Armorskin', 'Mega-Panzerhaut', 'Potion de pierre +', 'Megapiel armadura', 'Mistura ferrosa+', '???????', 3, '', 5, 5, 0, 269, 'Boosts your Defense even more than a regular Armorskin.', 'Aumenta la defensa más incluso que la piel de armadura.', 'Liquid-Orange.png', ''),
	(21, 'Adamant Pill', 'Diamantpille', 'Philtre de métal', 'Píldora armadura', 'Pillola ferrosa', '?????', 3, '', 1, 5, 0, 260, 'Temporarily makes your skin as hard as adamant. Potent!', 'Una píldora que aporta temporalmente a tu piel la fortaleza del metal.', 'Sac-Orange.png', ''),
	(22, 'Cool Drink', 'Kaltgetränk', 'Boisson fraîche', 'Bebida fría', 'Bevanda fresca', '????????', 3, '', 1, 5, 0, 30, 'Provides temporary relief from extreme heat.', 'Bebida que otorga una resistencia temporal al calor extremo.', 'Liquid-White.png', ''),
	(23, 'Hot Drink', 'Heißgetränk', 'Boisson chaude', 'Bebida caliente', 'Bevanda calda', '???????', 3, '', 1, 5, 0, 25, 'Provides temporary relief from extreme cold.', 'Bebida que otorga una resistencia temporal al frío extremo.', 'Liquid-Red.png', ''),
	(24, 'Cleanser', 'Reiniger', 'Nettoyant', 'Limpiador', 'Pulitore', '???', 3, '', 2, 10, 0, 14, 'Immediately removes any ice or mud on your body. Clean as a whistle!', 'Elimina toda la nieve o telarañas de tu cuerpo. ¡Sencillamente limpio!', 'Liquid-Cyan.png', ''),
	(25, 'Deodorant', 'Deodorant', 'Déodorant', 'Desodorante', 'Deodorante', '???', 3, '', 2, 10, 0, 8, 'An item that cures Stench. Releases a puff of deoderizing smoke when thrown down.', 'Objeto para curar el Hedor. Pulveriza humo desodorizante cuando se lanza.', 'Smoke-Blue.png', ''),
	(26, 'Psychoserum', 'Psychoserum', 'Sérum psychique', 'Psicosuero', 'Psicosiero', '?????', 3, '', 3, 10, 0, 30, 'Temporarily sharpens your sixth sense and attunes you to the ways of monsters.', 'Mejora temporalmente tu sexto sentido para detectar monstruos.', 'Liquid-Orange.png', ''),
	(27, 'Herbal Medicine', 'Kräutermedizin', 'Remède d\'herbe', 'Medicina herbal', 'Rimedio erboristico', '???', 3, '', 2, 10, 0, 25, 'Removes all traces of poison and restores a slight amount of Health.', 'Cura de forma eficaz el veneno y restablece ligeramente la salud.', 'Sac-White.png', ''),
	(28, 'Max Potion', 'Maxi-Trank', 'Potion secrète', 'Poción máxima', 'Pozione max', '??', 3, '', 3, 2, 0, 210, 'Fully restores Health and increases your maximum Health level all the way.', 'Aumenta el indicador de salud al máximo y recupera toda tu salud.', 'Sac-Yellow.png', ''),
	(29, 'Ancient Potion', 'Uralter Trank', 'Potion ancestrale', 'Poción antigua', 'Antica pozione', '???????', 3, '', 5, 1, 0, 345, 'Fully restores Health and Stamina, and raises the max levels of both all the way,', 'Restablece salud al máximo y aumenta los indicadores de salud y resistencia.', 'Sac-Red.png', ''),
	(30, 'Catalyst', 'Katalysator', 'Catalyseur', 'Catalizador', 'Catalizzatore', '???', 1, '', 2, 5, 0, 48, 'Works with other materials to enhance their effects. Cannot be used by itself.', 'Se mezcla con materiales para mejorar el efecto. No se puede usar solo.', 'Sac-Grey.png', ''),
	(31, 'Energy Drink', 'Energy-Drink', 'Boisson énergétique', 'Bebida energética', 'Bevanda energetica', '??????', 3, '', 2, 10, 0, 6, 'This bottle is all you\'ll need to wake up! Shakes off sleep and restores Stamina.', 'Bebida del gremio que sube tu resistencia. ¡Ayuda a quitar el sueño!', 'Liquid-Yellow.png', ''),
	(32, 'Gunpowder', 'Schießpulver', 'Poudre à canon', 'Pólvora', 'Polvere da sparo', '??', 1, '', 2, 20, 0, 45, 'A dangerous substance that explodes when struck or heated.', 'Peligrosa sustancia que explota al golpearla o calentarla.', 'Sac-Red.png', ''),
	(33, 'Lifecrystals', 'Lebenskristalle', 'Cristaux de vie', 'Cristales vida', 'Cristalli vitali', '????', 1, '', 3, 3, 0, 59, 'Mysterious crystals long worshipped as a source of life.', 'Misteriosos cristales adorados como fuente de vida.', 'Sac-White.png', ''),
	(34, 'Lifepowder', 'Lebenspulver', 'Poudre de vie', 'Polvo de vida', 'Polvere di vita', '?????', 3, '', 4, 3, 0, 315, 'A Lifecrystal combination used as medicine. Heals with a single touch.', 'Medicina hecha de cristales de vida. Cura de un toque a todos aquellos a su alcance.', 'Sac-White.png', ''),
	(35, 'Dust of Life', 'Lebensstaub', 'Poussière de vie', 'Fuente de vida', 'Linfa vitale', '??????', 3, '', 5, 2, 0, 100, 'A medicine with strone curative properties. Studied in secret, it is said to restore youth.', 'Medicina con propiedades curativas. Se dice que es la fuente de la juventud.', 'Sac-Teal.png', ''),
	(36, 'Disposable Earplugs', 'Einweg-Ohrstöpsel', 'Protège-tympans X', 'Tapones desechables', 'Tappi monouso', '????', 3, '', 5, 3, 0, 40, '', 'Tapones de un solo uso que anulan los efectos de los rugidos de los monstruos.', 'Sac-Pink.png', ''),
	(37, 'Tranquilizer', 'Betäubungsmittel', 'Tranquillisant', 'Tranquilizante', 'Tranquillante', '??????', 1, '', 4, 10, 0, 15, 'Medicine that works as an anesthetic when Combined.', 'Medicina que se usa como anestésico cuando se combina.', 'Liquid-Red.png', ''),
	(38, 'Mystery Charm', 'Rätselamulett', 'Charme étrange', 'Amuleto misterioso', 'Amuleto misterioso', '??????', 4, '', 4, 10, 0, 0, 'A modest good-luck charm. What does it do? Finish the Quest and you\'ll find out.', 'Modesto amuleto de la suerte. ¿Qué hace? Termina la aventura y lo averiguarás.', 'Charm-Stone-Grey.png', ''),
	(39, 'Shining Charm', 'Glänzendes Amulett', 'Charme brillant', 'Amuleto brillante', 'Amuleto lucente', '?????', 4, '', 5, 10, 0, 0, 'A curious good-luck charm. What does it do? Finish the Quest and you\'ll find out.', 'Curioso amuleto de la suerte. ¿Qué hace? Termina la aventura y lo averiguarás.', 'Charm-Stone-Yellow.png', ''),
	(40, 'Timeworn Charm', 'Altes Amulett', 'Charme ancien', 'Amuleto gastado', 'Amuleto consunto', '??????', 4, '', 6, 10, 0, 0, 'A powerful good-luck charm. What does it do? Finish the Quest and you\'ll find out.', 'Poderoso amuleto de la suerte. ¿Qué hace? Termina la aventura y lo averiguarás.', 'Charm-Stone-Red.png', ''),
	(41, 'Enduring Charm', 'Beständiges Amulett', 'Charme oublié', 'Amuleto eterno', 'Amuleto antico', '???????', 4, '', 7, 0, 0, 0, '', 'Misterioso amuleto de la suerte. ¿Qué hace? Termina la aventura y lo sabrás.', 'Charm-Stone-Blue.png', ''),
	(42, 'Distorted Charm', 'Zerr-Amulett', 'Charme déformé', 'Amuleto deforme', 'Amuleto distorto', '??????', 4, '', 6, 10, 0, 0, '', 'Un versátil amuleto de la suerte. ¿Qué hace? Completa la aventura y lo averiguarás.', 'Charm-Stone-Orange.png', ''),
